import React from 'react';
import './App.css';
const e = React.createElement;
function App() {
  return (
    e('div',{className:'container'},
      e('div',{className:'console'},
        e('p',{},'Console'),
        e('textarea',{className:'console-body'},'dsadsad'),
        e('button',{},'Clear')
      ),
      e('div',{className:'admin-panel'},'console'),
    )
  );
}

export default App;
